import React from 'react';
import { Box, Stack, Typography } from '@mui/material';
import '../index.css';

import Navbar from '../Components/Navigation/NavBar';
import Footer from '../Components/Footer/Footer';
import UpcomingEventsText from '../Components/UpcomingEvents/UpcomingEventsText';
import UpcomingEventsImage from '../Components/ImageDisplay/UpcomingEventsImage';
import MobileUpcomingEventsImage from '../Components/ImageDisplay/MobileUpcomingEventsImage';
import BookSigningPicture from '../Components/ImageDisplay/BookSigningPicture';
import MobileBookSigningPicture from '../Components/ImageDisplay/MobileBookSigningPicture';

// TODO: Fix the height of the title and buttons on the tablet screen.
export default function UpcomingEvents() {
	return (
		<>
			<div
				className="upcoming-events"
				style={{
					display: 'flex',
					alignItems: 'center',
					justifyContent: 'flex-end',
					height: '100vh',
					width: '100vw',
					paddingTop: '11rem',
				}}
			>
				<Navbar />
				<Stack
					direction="column"
					display={{ xs: 'none', sm: 'flex' }}
					sx={{
						alignItems: 'center',
						paddingBottom: { sm: '12rem', md: '9rem', lg: 0 },
					}}
				>
					<Box>
						<BookSigningPicture
							display={{ xs: 'none', sm: 'flex' }}
							height={{
								sm: '25rem',
								md: '32rem',
								lg: '33rem',
								xl: '36rem',
							}}
						/>
					</Box>
				</Stack>
				<Box
					sx={{
						display: 'block',
						paddingRight: { xs: 2, sm: 4, md: 15, lg: 35, xl: 80 },
						paddingTop: { sm: 14, md: 17, lg: 10, xl: 6 },
						paddingBottom: { md: 15, lg: 9, xl: 9 },
					}}
				>
					<Box>
						<MobileBookSigningPicture
						/>
					</Box>
					<Typography
						variant="h3"
						sx={{
							display: 'block',
							width: '100%',
							color: '#4E5865',
							textTransform: 'capitalize',
							paddingLeft: { xs: 2, sm: 4, md: 10 },
							textAlign: 'left',
							letterSpacing: { xs: '2px', sm: '1px' },
							fontFamily: 'Inter, sans-serif',
							fontSize: { xs: 21, sm: 25, lg: 25 },
						}}
						gutterBottom
					>
						A Woman's Worth
					</Typography>
					<Typography
						variant="h3"
						sx={{
							display: 'block',
							width: '100%',
							color: '#4E5865',
							textTransform: 'capitalize',
							fontWeight: 'bold',
							paddingLeft: { xs: 2, sm: 4, md: 10 },
							textAlign: 'left',
							letterSpacing: { xs: '5px', sm: '10px' },
							fontFamily: 'Inter, sans-serif',
							fontSize: { xs: 36, sm: 48, lg: 60 },
						}}
					>
						BOOK
					</Typography>
					<Typography
						variant="h3"
						sx={{
							display: 'block',
							width: '100%',
							color: '#4E5865',
							textTransform: 'capitalize',
							fontWeight: 'bold',
							paddingLeft: { xs: 2, sm: 4, md: 10 },
							textAlign: 'left',
							letterSpacing: { xs: '5px', sm: '10px' },
							fontFamily: 'Inter, sans-serif',
							fontSize: { xs: 36, sm: 48, lg: 60 },
							marginBottom: { sm: 20, md: 0 },
						}}
						gutterBottom
					>
						SIGNING
					</Typography>
				</Box>
			</div>
			<Stack
				direction="row"
				spacing={{ sm: 3, md: 9 }}
				sx={{ display: { xs: 'none', sm: 'flex' }, padding: { sm: 6, lg: 10 } }}
			>
				<UpcomingEventsText />
				<UpcomingEventsImage />
			</Stack>
			<Stack
				direction="column"
				sx={{ display: { xs: 'flex', sm: 'none' }}}
			>
				<UpcomingEventsText />
        <MobileUpcomingEventsImage/>
			</Stack>
			<Footer />
		</>
	);
}
